import React from "react";
import axios from "axios"; 


class Result extends React.Component {
    constructor(props) {
        super(props); 
    }
    render() {
        return (
            <ul> 
                {this.props.compressArray(this.state.results).map((item, index) =>  <li key={index}> {item.value} </li>)}
            </ul>
        )
    }
}

export default Result;
